CREATE DEFINER=`root`@`localhost` PROCEDURE `getGuiasDisponiblesByFechas` (IN `id_age` INT(11), IN `fecha_ini` VARCHAR(20), IN `fecha_fin` VARCHAR(20))  NO SQL
SELECT
	a.id,
	a.guia_hija_id,
	a.num_guia,
	a.peso2,
	a.declarado2,
	a.shipper_id,
	a.consignee_id,
	DATE_FORMAT(a.created_at,'%Y-%m-%d') as created_at
FROM
	guia_hija_detalle AS a
INNER JOIN guia_hija AS b ON b.id = a.guia_hija_id
WHERE
	a.deleted_at IS NULL
