CREATE DEFINER=`root`@`localhost` FUNCTION `fn_ConsecutivoByTipoDocumento` (`id_tipo_documento` INT) RETURNS INT(11) NO SQL
RETURN (SELECT
tipo_documento.consecutivo_inicial
FROM
tipo_documento
WHERE
tipo_documento.id = id_tipo_documento AND
tipo_documento.deleted_at IS NULL) + 
(SELECT
Count(a.tipo_id) AS consecutivo
FROM
auxiliar_consecutivo AS a
WHERE
a.deleted_at IS NULL AND
a.tipo_id = id_tipo_documento )$$

