INSERT INTO `plantillas_correo` (`id`, `agencia_id`, `nombre`, `subject`, `mensaje`, `descripcion_plantilla`, `otros_destinatarios`, `enviar_archivo`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 1, 'Llegada Casillero', 'Su paquete ha llegado a nuestra bodega. Recibo Número {id}', '&lt;h2&gt;Pedido #  {id}  &lt;/h2&gt;&lt;table&gt;&lt;tbody&gt;&lt;tr&gt;&lt;td&gt;&lt;h3&gt;Dirección de envío:&lt;/h3&gt;&lt;/td&gt;&lt;td style=&quot;text-align: right;&quot;&gt;&lt;/td&gt;&lt;td style=&quot;text-align: right;&quot;&gt;&lt;h3&gt;Resumen del Pedido&lt;/h3&gt;&lt;/td&gt;&lt;/tr&gt;&lt;tr&gt;&lt;td&gt;  {nom_consignee}  &lt;/td&gt;&lt;td style=&quot;text-align: right;&quot;&gt;Valor: (Flete+Impuesto): &lt;/td&gt;&lt;td style=&quot;text-align: right;&quot;&gt;$   {flete_impuesto}  &lt;/td&gt;&lt;/tr&gt;&lt;tr&gt;&lt;td&gt;  {dir_consignee}  &lt;/td&gt;&lt;td style=&quot;text-align: right;&quot;&gt;Seguro: &lt;/td&gt;&lt;td style=&quot;text-align: right;&quot;&gt;$   {seguro}  &lt;/td&gt;&lt;/tr&gt;&lt;tr&gt;&lt;td&gt;  {ciu_consignee}  ,   {depto_consignee}   -   {zip_consignee}  &lt;/td&gt;&lt;td style=&quot;text-align: right;&quot;&gt;Descuento: &lt;/td&gt;&lt;td style=&quot;text-align: right;&quot;&gt;$   {descuento}  &lt;/td&gt;&lt;/tr&gt;&lt;tr&gt;&lt;td&gt;  {pais_consignee}  &lt;/td&gt;&lt;td style=&quot;text-align: right;&quot;&gt;Otros: &lt;/td&gt;&lt;td style=&quot;text-align: right;&quot;&gt;$   {cargos_add} &lt;/td&gt;&lt;/tr&gt;&lt;tr&gt;&lt;td&gt;&lt;/td&gt;&lt;td style=&quot;text-align: right;&quot;&gt;Total: &lt;/td&gt;&lt;td style=&quot;text-align: right;&quot;&gt;$   {total}  &lt;/td&gt;&lt;/tr&gt;&lt;/tbody&gt;&lt;/table&gt; &lt;br&gt;&lt;br&gt;&lt;hr&gt; &lt;strong&gt;Envios:&lt;/strong&gt;&lt;br&gt;&lt;br&gt; {datos_detalle}&lt;br&gt;&lt;br&gt;&lt;br&gt;&lt;br&gt;&lt;strong&gt;Servicio al Cliente&lt;/strong&gt;&lt;br&gt;{nom_agencia}&lt;br&gt;T: {tel_agencia}&lt;br&gt;e: {email_agencia}&lt;br&gt;&lt;br&gt;&lt;br&gt; La información contenida en este e-mail y sus anexos, es confidencial y solo puede ser utilizada por la persona a la cual está dirigida Si usted no es el receptor autorizado, cualquier retención, difusión, distribución o copia de este mensaje y sus anexos, es prohibida y sancionada por la ley Si por error recibe este mensaje, por favor reenviarlo al remitente y borrar el mensaje recibido inmediatamente.', 'Llegada Casillero', NULL, 0, '2017-04-19 05:00:00', NULL, NULL),
(2, 1, 'Envio Warehouse', 'Su envío ha sido recibido en nuestra bodega (Recibo: {num_warehouse})', '{nom_consignee}  , su envío ha sido recibido en nuestra bodega procedente de   {nom_shipper}  , a partir de ahora podrás rastrearlo haciendo clic <a href="http://demo.4plbox.com/web/index.php/rastreo/index" target="_blank">aquí</a><br> <br><br><br><strong>Detalles: </strong><br><br>{datos_detalle}<br><br><br><br><strong>Servicio al Cliente</strong><br>{nom_agencia}<br>T: {tel_agencia}<br>e: {email_agencia}<br><br><br>La información contenida en este e-mail y sus anexos, es confidencial y solo puede ser utilizada por la persona a la cual está dirigida Si usted no es el receptor autorizado, cualquier retención, difusión, distribución o copia de este mensaje y sus anexos, es prohibida y sancionada por la ley Si por error recibe este mensaje, por favor reenviarlo al remitente y borrar el mensaje recibido inmediatamente.', 'Plantilla para el envio de emails en los warehouses', NULL, 1, '2017-04-20 05:00:00', '2018-08-29 22:30:44', NULL),
(3, 1, 'Bienvenida  Casillero', 'Bienvenido', '<div style="text-align: center;"><span style="color: inherit;">Bienvenido</span></div><div style="text-align: center;"><span style="font-size: 15px;"><br></span></div><div style="text-align: center;"><span style="color: inherit;">{nom_consignee}</span></div><div style="text-align: center;"><span style="font-size: 15px;"><br></span></div><div style="text-align: center;"><span style="color: inherit;">Usted se ha registrado a nuestro servicio de casillero, a partir de ahora cuenta con una dirección física en {pais_agencia}, sus compras o encomiendas que deba realizar, debe dirigirlos a la siguiente dirección:</span></div><div style="text-align: center;"><span style="font-size: 15px;"><br></span></div><strong><div style="text-align: center;"><strong style="color: inherit;">Dirección:</strong><span style="color: inherit;"> {dir_agencia}.</span></div></strong><strong><div style="text-align: center;"><strong style="color: inherit;">Ciudad:</strong><span style="color: inherit;"> {ciudad_agencia}</span></div></strong><strong><div style="text-align: center;"><strong style="color: inherit;">Estado:</strong><span style="color: inherit;"> {estado_agencia}</span></div></strong><strong><div style="text-align: center;"><strong style="color: inherit;">Código Postal:</strong><span style="color: inherit;"> {zip_agencia}</span></div></strong><div style="text-align: center;"><span style="font-size: 15px;"><br></span></div><div style="text-align: center;"><span style="color: inherit;">El código de casillero asignado a usted es: {pobox_consignee}</span></div><div style="text-align: center;"><span style="font-size: 15px;"><br></span></div><div style="text-align: center;"><span style="color: inherit;">-----------------------------------------------</span></div><div style="text-align: center;"><span style="color: inherit;">Sus datos de acceso al sistema son:</span></div><div style="text-align: center;"><span style="font-size: 15px;"><br></span></div><strong><div style="text-align: center;"><strong style="color: inherit;">Link:</strong><span style="color: inherit;"> {url_principal}/</span><span style="color: inherit;">{id_agencia}</span></div></strong><strong><div style="text-align: center;"><strong style="color: inherit;">Usuario:</strong><span style="color: inherit;"> {email_consignee}</span></div></strong><strong><div style="text-align: center;"><strong style="color: inherit;">Contraseña:</strong><span style="color: inherit;"> {pass_consignee}</span></div></strong><div style="text-align: center;"><span style="font-size: 15px;"><br></span></div><div style="text-align: center;"><span style="font-size: 15px;"><br></span></div><div style="text-align: center;"><span style="color: inherit;">-----------------------------------------------</span></div><div style="text-align: center;"><span style="font-size: 15px;"><br></span></div><div style="text-align: center;"><span style="color: inherit;">Los envíos a {pais_consignee}, se realizarán a la siguiente dirección:</span></div><div style="text-align: center;"><span style="font-size: 15px;"><br></span></div><strong><div style="text-align: center;"><strong style="color: inherit;">Dirección:</strong><span style="color: inherit;"> {dir_consignee}.</span></div></strong><strong><div style="text-align: center;"><strong style="color: inherit;">Ciudad:</strong><span style="color: inherit;"> {ciu_consignee}</span></div></strong><strong><div style="text-align: center;"><strong style="color: inherit;">Departamento / Estado:</strong><span style="color: inherit;"> {depto_consignee}</span></div></strong><strong><div style="text-align: center;"><strong style="color: inherit;">Código Postal:</strong><span style="color: inherit;"> {zip_consignee}</span></div></strong><div style="text-align: center;"><span style="font-size: 15px;"><br></span></div><div style="text-align: center;"><span style="font-size: 15px;"><br></span></div><div style="text-align: center;"><span style="color: inherit;">Los alertas del sistema se enviarán al email: {email_consignee} El teléfono de contacto con el cual nos comunicaremos en caso de ser requerido será: Movil: {cel_consignee} o Fijo: {tel_consignee}.</span></div><div style="text-align: center;"><br></div>', 'Envio de email al usuario casillero', NULL, 0, '2017-04-21 05:00:00', '2018-05-21 20:17:51', NULL);
